import { Application, DatePicker } from 'react-rainbow-components';
import React, { useEffect, useState } from 'react';
import { useTheme } from "@mui/material";
import { createTheme } from "@mui/material/styles"; // Step 1: Import createTheme
import { tokens, useMode, ColorModeContext } from "../theme"; // Step 2: Import useMode and ColorModeContext

const initialState = {
    range: undefined,
};
const containerStyles = {
    maxWidth: 400,
};

const Search = () => {
    const Mytheme = useTheme();
    const colors = tokens(Mytheme.palette.mode);
    const theme = {
        rainbow: {
            palette: {
                brand: colors.primary[100], // text inside calendar
                mainBackground: colors.primary[400], // background of calendar
                border: colors.primary[300], // border color of calendar
                text: colors.grey[100], // text color in text
            },
        },
    };

    return (
        <ColorModeContext.Provider value={useMode()[1]}> {/* Step 5: Wrap the component with the ColorModeContext.Provider */}
            <div className="dash" style={{ paddingLeft: '20px' }}>
                <Application theme={createTheme(Mytheme)}> {/* Step 4: Pass the custom theme */}
                    <h1>Search</h1>
                    <DatePicker
                        id="datePicker-15"
                        label="DatePicker Label"
                        placeholder="Select range of dates"
                        selectionType="range"
                        formatStyle="large"
                        variant="single"
                        // value={state.range}
                        // onChange={value => setState({ range: value })}
                    />
                </Application>
            </div>
        </ColorModeContext.Provider>
    )
}

export default Search;
